webpackJsonp([0x8a359d5db3ab],{4880:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"im in ur serverz",date:"16 May 2007",slug:"/2007-05-16-im-in-ur-serverz/",tags:"Y2007"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/05/im-in-ur-serverz.gif" alt="im in ur serverz" /></p>\n<p>This seems to be <a href="http://static.twitter.com/system/maintenance/maintenance.gif">Twitter\'s</a> maintenance graphic, as opposed to a <a href="http://www.flickr.com/photos/elderzhang/268338116/">plumber</a> or a  <a href="http://www.flickr.com/photos/teo/6126518/">massage</a>. <a href="http://www.dashes.com/anil/2007/04/cats-can-has-gr.html">Lolcats</a> must be the new black.</p>'},next:{fields:{title:"Dibbersen/Buchholz",date:"15 May 2007",slug:"/2007-05-15-dibbersenbuchholz/"}},previous:{fields:{title:"The Problem With No",date:"16 May 2007",slug:"/2007-05-16-the-problem-with-no/"}}},{node:{fields:{title:"Dibbersen/Buchholz",date:"15 May 2007",slug:"/2007-05-15-dibbersenbuchholz/",tags:"Y2007"},html:'<p>Now that official notice of the upcoming change in ownership has been posted in the restaurant, I am proud to announce that the first location of the Frauke Petersen-Hanson Systemgastronomie GmbH i.G. will be located at **Harburger Str. 19 in Dibbersen/Buchholz**, on the Autobahn A1 between Bremen and Hamburg. For us the restaurant is just 10 minutes drive from home.</p>\n<p><a href="http://www.flickr.com/photos/papascott/499677510/" title="Photo Sharing"><img src="http://farm1.static.flickr.com/208/499677510_c2fb7ddf5c.jpg" width="500" height="375" alt="Dibbersen" /></a></p>\n<p>The restaurant with McDrive was opened in 2003 and does not yet have a McCafé. It is located near a thriving commercial area with the furniture store Möbel Kraft and a new Obi home improvement store. A Famila supermarket and a MediaMarkt electronics store are planned for this year. We have every reason to expect satisfaction and success for years to come.</p>\n<p>**Update:** MamaMaus has a soft spot for signage. This will be ours.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2007/05/dibberson-sign.jpg" alt="sign" height="352" width="264" /></p>'},next:{fields:{title:"Concrete",date:"12 May 2007",slug:"/2007-05-12-concrete/"}},previous:{fields:{title:"im in ur serverz",date:"16 May 2007",slug:"/2007-05-16-im-in-ur-serverz/"}}},{node:{fields:{title:"Concrete",date:"12 May 2007",slug:"/2007-05-12-concrete/",tags:"Y2007"},html:"<p>Our plans for <a href=\"http://www.papascott.de/archives/2007/03/27/bricks-and-mortar/\">taking over the restaurant</a> on 1 July are slowing becoming concrete.</p>\n<ul>\n<li>MamaMaus' last day of work at the office is Monday. On Tuesday she begins in-store training (at a company restaurant, not our future location). Her employment officially ends on 30 June.</li>\n<li>\n<p>The papers for the GmbH will be signed on Wednesday. The tax advisor says we don't need the 'Co KG', so we're skipping it.</p>\n</li>\n<li>\n<p>Written notice of the change in ownership will be posted at the restaurant on Monday, and a formal employee meeting is scheduled a week later. At that point I can say here where we will be located (but if you ask me by mail, I'll tell you).</p>\n</li>\n<li>\n<p>The franchise contract (over 2 cm thick) arrived by courier yesterday, so we now have a final purchase price that can be signed and sent back.</p>\n</li>\n</ul>\n<p><strong>Update 15 May 2007:</strong> MamaMaus was afraid the tone of this post would be misunderstood, so it's been edited to more accurately reflect our true feelings of giddiness and excitement.</p>"},next:{fields:{title:"Why Franchisees Fail",date:"11 May 2007",slug:"/2007-05-11-why-franchisees-fail/"}},previous:{fields:{title:"Dibbersen/Buchholz",date:"15 May 2007",slug:"/2007-05-15-dibbersenbuchholz/"}}}],pathPrefix:"",first:!1,last:!1,index:129,pageCount:1101}}}});
